import React from "react";
import Btn from "../componenets/Btn";
import Page1_6Nav from "../componenets/Page1_6Nav";

function Page4(props) {
  return (
    <div>
      <h1>page4</h1>
      <Page1_6Nav text1="계정만들기" text2="로그인" link1="/5" />
      <Btn text="시작하기" link="/5" />
      <p>아직 화분이 없어요.</p>
    </div>
  );
}

export default Page4;
